import React, { useState } from 'react'
import jetiLogo from './Img/jetLogo.jpg';
import guiLogo from './Img/guiLogo.jpg';
import tsLogo from './Img/tsLogo.jpg';
import lordeLogo from './Img/lordeLogo.jpg';
import ufsmLogo from './Img/ufsmLogo.jpg';
import './style.css';

export function Stories() {

    const [popup, setPopup] = useState(false)

    const togglePopup = () => {
        setPopup(!popup)
    }

    return (
        <div className="stories-box">
            <ul className="stories-circles">
                <li className="user1">
                <img onClick={togglePopup} className="stories-pic" src={jetiLogo} alt="Logo" />
                    <p>Seu story</p>
                    
                {popup && (
                    <div className="popup">
                    <div onClick={togglePopup} className="opaque-overlay"></div>
                    <div className="popup-content">
                        <h2>Teste</h2>
                    </div>
                </div>
                )}
                </li>
                
                <li className="user1">
                <img className="stories-pic" src={guiLogo} alt="Logo2" />
                    <p>glhrmrg</p>
                </li>

                <li className="user1">
                <img className="stories-pic" src={tsLogo} alt="Logo2" />
                    <p>taylorswift</p>
                </li>

                <li className="user1">
                <img className="stories-pic" src={ufsmLogo} alt="Logo2" />
                    <p>ufsm.br</p>
                </li>

                <li className="user1">
                <img className="stories-pic" src={lordeLogo} alt="Logo2" />
                    <p>lorde</p>
                </li>
            </ul>
        </div>

    )

};
